import React, { Component } from 'react';
import ArrangerAdmin from '@arranger/admin-ui/dist';

class Home extends Component {

  render() {

    console.log("Home page");

    let message =

      <React.Fragment>

        <section>
          <div>
            <h1>
              <strong> ARRANGER TESTING ZONE II</strong>
            </h1>
          </div>
        </section>
        <section>
          <ArrangerAdmin/>
        </section>

      </React.Fragment>

    return (
      <div>
        {message}
      </div>
    )
  }
}

export default Home;
